import React, { Component } from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import '../css/nav.css'
import logo from '../img/bean.png'
import {
  Nav,
  NavItem,
  Navbar,

  NavbarBrand,

} from 'reactstrap'
export default class Navigation extends Component {
  scrollToTop = () => {
    scroll.scrollToTop();
  };

  render() {
    return (
      <Navbar color="light" light expand="md">
      <NavbarBrand >
          <img
            style = {{height: '25px'}}
            src = {logo}
            className="nav-logo"
            alt="Logo"
            onClick={this.scrollToTop}
          />
          </NavbarBrand>
          <Nav className="mr-auto" navbar>
          <NavItem>
              <Link
                activeClass="active"
                to="section1"
                spy={true}
                smooth={true}
                offset={-70}
                duration={300}
              >
                Section 1
              </Link>
              </NavItem>

           <NavItem>
              <Link
                activeClass="active"
                to="about"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Section 2
              </Link>
              </NavItem>
            <NavItem>
              <Link
                activeClass="active"
                to="section3"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Section 3
              </Link>
              </NavItem>
              <NavItem>
              <Link
                activeClass="active"
                to="section4"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Section 4
              </Link>
              </NavItem>
              <NavItem>
              <Link
                activeClass="active"
                to="section5"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Section 5
              </Link>
              </NavItem>
         </Nav>

      </Navbar>
    );
  }
}
